import {Route, Switch, withRouter, Redirect} from 'react-router-dom';
import './App.scss';
import SRP from '../src/Containers/SRP';

function App() {
  let routes = (
      <Switch>
          <Route path="/privacy-policy" render={(props) => <Auth {...props} />} />
          <Route path="/" exact component={SRP} />
          <Redirect to='/' />
      </Switch>
  );

  return (
    <div className="App">
      {routes}
    </div>
  );
}

export default withRouter(App);
